import { useState, useCallback } from "react";
//import StudentMode from "../components/StudentMode";
import PortalPopup from "../components/PortalPopup";
import { useNavigate } from "react-router-dom";
import "./DASHBOARDPARENTCOURSES.css";

const DASHBOARDPARENTCOURSES = () => {
  const [isStudentModeOpen, setStudentModeOpen] = useState(false);
  const navigate = useNavigate();

  const onContactUsClick = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onGroupContainer1Click = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onProgressClick = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onGroupContainer2Click = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onHomeClick = useCallback(() => {
    navigate("/20-dashboard-home-paretnt");
  }, [navigate]);

  const onGroupContainer6Click = useCallback(() => {
    navigate("/20-dashboard-home-paretnt");
  }, [navigate]);

  const onSettingsClick = useCallback(() => {
    navigate("/14-dashboard-parent-settings");
  }, [navigate]);

  const onGroupContainer10Click = useCallback(() => {
    navigate("/14-dashboard-parent-settings");
  }, [navigate]);

  const onGroupContainer11Click = useCallback(() => {
    const anchor = document.querySelector("[data-scroll-to='aralin1Pagbati']");
    if (anchor) {
      anchor.scrollIntoView({ block: "start", behavior: "smooth" });
    }
  }, []);

  const openStudentMode = useCallback(() => {
    setStudentModeOpen(true);
  }, []);

  const closeStudentMode = useCallback(() => {
    setStudentModeOpen(false);
  }, []);

  return (
    <>
      <div className="dashboard-parent-courses">
        <div className="group-parent26">
          <div className="rectangle-parent29">
            <div className="group-child45" />
            <div className="contact-us-parent12">
              <button className="contact-us16" onClick={onContactUsClick}>
                <div
                  className="contact-us-inner5"
                  onClick={onGroupContainer1Click}
                >
                  <div className="contact-us-parent13">
                    <div className="contact-us17">Contact Us</div>
                    <img className="vector-icon56" alt="" src="/vector.svg" />
                  </div>
                </div>
              </button>
              <button className="progress16" onClick={onProgressClick}>
                <div
                  className="vector-parent27"
                  onClick={onGroupContainer2Click}
                >
                  <img className="vector-icon57" alt="" src="/vector1.svg" />
                  <div className="progress17">Progress</div>
                </div>
              </button>
              <div className="vector-parent28">
                <img className="vector-icon58" alt="" src="/vector2.svg" />
                <div className="parent-mode10">Parent Mode</div>
              </div>
            </div>
          </div>
          <button className="home11" onClick={onHomeClick}>
            <div className="home-parent7" onClick={onGroupContainer6Click}>
              <div className="home12">Home</div>
              <img className="vector-icon59" alt="" src="/vector3.svg" />
            </div>
          </button>
        </div>
        <div className="dashboard-parent-courses-child" />
        <div className="dashboard-parent-courses-item" />
        <img
          className="microsoftteams-image-1-16"
          alt=""
          src="/microsoftteamsimage-1-1@2x.png"
        />
        <div className="rectangle-parent30">
          <div className="group-child46" />
          <div className="group-child47" />
          <img className="group-child48" alt="" src="/ellipse-12@2x.png" />
          <div className="marie-antoinette-cruz-container2">
            <p className="blank-line">Marie ANTOINETTE CRUZ</p>
          </div>
        </div>
        <img className="vector-icon60" alt="" src="/vector5.svg" />
        <img
          className="dashboard-parent-courses-inner"
          alt=""
          src="/group-78.svg"
        />
        <img
          className="dashboard-parent-courses-child1"
          alt=""
          src="/rectangle-81.svg"
        />
        <div className="dashboard-parent-courses-child2" />
        <div className="unang-antas">Unang Antas:</div>
        <div className="progress18">progress:</div>
        <div className="eggs" />
        <img
          className="dashboard-parent-courses-child3"
          alt=""
          src="/group-93.svg"
        />
        <img
          className="dashboard-parent-courses-child4"
          alt=""
          src="/group-93.svg"
        />
        <img
          className="dashboard-parent-courses-child5"
          alt=""
          src="/group-95.svg"
        />
        <div className="eggs1">
          <img className="eggs-child" alt="" src="/group-83.svg" />
        </div>
        <div className="in-progress">in progress</div>
        <div className="completed">completed</div>
        <div className="completed1">completed</div>
        <div className="completed2">completed</div>
        <div className="completed3">completed</div>
        <div className="completed4">completed</div>
        <div className="completed5">completed</div>
        <div className="aralin-1-pagbati-at-karaniwan-wrapper">
          <div
            className="aralin-1-pagbati-container"
            data-scroll-to="aralin1Pagbati"
          >
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">
              {" "}
              Aralin 1: Pagbati at Karaniwang Pananalita
            </p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">{` Aralin 2: Batayang Bokabularyo at mga Bilang `}</p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">
              Aralin 3: Payak na Balangkas ng Pangungusap
            </p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line"> Aralin 4: Pamilya at mga Ugnayan</p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">
              {" "}
              Aralin 5: Konteksto ng Kultura at mga Tradisyon
            </p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">&nbsp;</p>
            <p className="blank-line">&nbsp;</p>
          </div>
        </div>
        <div className="kurso-1-pambungad">
          Kurso 1: Pambungad sa Wikang Filipino
        </div>
        <div className="kurso-2-pagsasalita">{` Kurso 2: Pagsasalita at Pagsulat `}</div>
        <div className="wrapper-line-12">
          <img className="wrapper-line-12-child" alt="" src="/line-12.svg" />
        </div>
        <div className="wrapper-line-13">
          <img className="wrapper-line-13-child" alt="" src="/line-12.svg" />
        </div>
        <div className="aralin-1-pagbigkas-container">
          <p className="blank-line">{`Aralin 1: Pagbigkas at Pagsasanay sa Pakikipag-usap `}</p>
          <p className="blank-line">&nbsp;</p>
          <p className="blank-line">{`Aralin 2: Pambungad sa Alpabetong Filipino `}</p>
          <p className="blank-line">&nbsp;</p>
        </div>
        <div className="not-yet-started">not yet started</div>
        <div className="not-yet-started1">not yet started</div>
        <img
          className="dashboard-parent-courses-child6"
          alt=""
          src="/group-91.svg"
        />
        <img
          className="dashboard-parent-courses-child7"
          alt=""
          src="/group-91.svg"
        />
        <button className="settings20" onClick={onSettingsClick}>
          <div className="group-parent27" onClick={onGroupContainer10Click}>
            <img className="group-icon10" alt="" src="/group.svg" />
            <div className="settings21">Settings</div>
          </div>
        </button>
        <button className="courses19">
          <div className="vector-parent29" onClick={onGroupContainer11Click}>
            <img className="vector-icon61" alt="" src="/vector4.svg" />
            <div className="courses20">Courses</div>
          </div>
        </button>
        <button className="rectangle-parent31" onClick={openStudentMode}>
          <div className="group-child49" />
          <img className="group-child50" alt="" src="/ellipse-5.svg" />
        </button>
      </div>
      {isStudentModeOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeStudentMode}
        >
          <StudentMode onClose={closeStudentMode} />
        </PortalPopup>
      )}
    </>
  );
};

export default DASHBOARDPARENTCOURSES;
